for(i <- 0 to (s.length -1)){
    val y = Array("Test", i, "t").mkString
    val hello = s(i).toJSON.toDF.withColumn("id", when($"_1"==="sup", y).otherwise(y)).groupBy("id").agg(collect_list("_1").cast("String").alias("value")).withColumn("value", regexp_replace($"value", "},", "};")).withColumn("value", regexp_replace($"value", "\\[|\\]", ""))
    val sup = hello.rdd.map(x => "\\[|\\]".r.replaceAllIn(x.toString, "").split("t,")).map(x=> (x(0), x(1)))
    sc.toRedisKV(sup, (6379))
}
